import Link from 'next/link'

const Toolbar = () => {
	return (
		<div
			style={{
				display: 'flex',
				justifyContent: 'center',
				alignItems: 'center',
			}}
		>
			<Link href="/">
				<div style={{ margin: '20px', cursor: 'pointer' }}>Home</div>
			</Link>
			<Link href="/about">
				<div style={{ margin: '20px', cursor: 'pointer' }}>About</div>
			</Link>
		</div>
	)
}

export default Toolbar
